{
  "data": {
    "event": {
      "title": "Discussion of Kaggle Competition: House Prices: Advanced Regression Techniques",
      "description": "Please join us for the first meeting of 2017 where we will be discussing the Kaggle Competition \"House Prices: Advanced Regression Techniques\" https://www.kaggle.com/c/house-prices-advanced\n\nThe idea of the discussion is that everyone takes a look at the competition, maybe reads the forums and attempt the competition, then we meet to discuss. How much time you spend looking at the competition before the meeting is upto you. We will share what we have learnt and questions of things we are unsure of. Everyone will be given a chance to share if they like.\n\nBig thanks to GridAKL for supplying the venue. I am pleased to say the RSVP is higher this time. Discussion will be in the tech cafe space.\n\nSchedule of meeting\n\n6:15 Arrive and informal chat\n\n6:30 Discussion begins\n\n7:30 Discussion ends",
      "dateTime": "2017-03-02T18:15+13:00",
      "eventUrl": "https://www.meetup.com/Data-Science-Discussion-Auckland/events/237794504",
      "going": 37,
      "waiting": 0,
      "eventType": "physical"
    }
  }
}

{
  "data": {
    "event": {
      "title": "NLP in NZ - How I turned my PhD in NLP into a Silicon Valley startup",
      "description": "To attend, you must RSVP to this event on this page: https://www.meetup.com/Natural-Language-Processing-in-NZ/events/264589217/\n_____________________________________________________________________________________\n\nMeetup Description:\n\nLast month I spoke at the BayArea NLP Meetup about my path from a PhD at Waikato to starting a startup. Since I'm visiting Auckland again, I thought it might be cool to catch up and I could repeat this talk:\n\n\"Alyona Medelyan will be sharing her story of discovering NLP while studying linguistics and pivoting her degree into CS and Machine Learning. She will explain the ML framework of the keyword extraction algorithm KEA, powered by one of the first ML libraries WEKA. Having co-authored the most-cited study of using Wikipedia in NLP research, she'll share two of her own projects that use it, including Maui, which ended up getting onto the radar of NATO.\n\nAlyona's passion lies in commercialization of research ideas. On her third attempt she managed to start a company that uses the ideas from her PhD to solve a problem most companies struggle with today: understanding the needs of their customers. She will share how she co-founded Thematic and the what was required to turn it into a successful venture.\"",
      "dateTime": "2019-09-18T18:00+12:00",
      "eventUrl": "https://www.meetup.com/Data-Science-Discussion-Auckland/events/264741445",
      "going": 1,
      "waiting": 21,
      "eventType": "physical"
    }
  }
}

{
  "data": {
    "event": {
      "title": "Data Science and COVID-19",
      "description": "As data scientists, we've all had a difficult time not getting stuck into the numbers of this current pandemic. This meetup we will run our usual discussion format with the topic of applying data science to any of the data coming out around COVID-19. You can share any visualisations, modelling or predictions that you have made, as well as ask questions around how to model this type of data / event.\n\nWe will be meeting up over Zoom, so if you haven't already, please install it beforehand. The link will be shared no later than the morning of the event.\n\nSome useful links:\n- Daily statistics by country - https://github.com/CSSEGISandData/COVID-19\n- Kaggle COVID-19 - https://www.kaggle.com/covid19\n\nSome Ideas:\n- Time series predictions\n- Predicting what measures are the most successful in slowing transmission",
      "dateTime": "2020-04-09T18:30+12:00",
      "eventUrl": "https://www.meetup.com/Data-Science-Discussion-Auckland/events/269295825",
      "going": 30,
      "waiting": 36,
      "eventType": "online"
    }
  }
}

{
  "data": {
    "event": {
      "title": "A Path to the Fundamental Theory of Physics",
      "description": "This week we have something a little bit different... We are going to be reviewing and discussing the recent blogpost by Stephen Wolfram entitled \"Finally We May Have a Path to the Fundamental Theory of Physics… and It’s Beautiful\" The discussion will start with a review of Wolfram's work presented by John Graves.\n\nHere is a link to the blog: https://blog.wolfram.com/2020/04/14/finally-we-may-have-a-path-to-the-fundamental-theory-of-physics-and-its-beautiful/\nOther related links:\n- https://www.wolframphysics.org/universes/\n- https://www.wolframcloud.com/\n- https://www.wolframscience.com/nks/\n\nAs always we encourage you to read the material before coming to the meet up. It is fine if you do not understand it all. The purpose of this meetup to learn and to ask questions.\n\nHave a think about any research papers or Kaggle competitions you would like to discuss in future meetups. We will spend a few minutes on this at the end.\n\nWe will be most likely holding this event online, given the recent circumstances. Information about connecting to the meeting will be sent out closer to the time.",
      "dateTime": "2020-05-21T18:30+12:00",
      "eventUrl": "https://www.meetup.com/Data-Science-Discussion-Auckland/events/270411000",
      "going": 38,
      "waiting": 0,
      "eventType": "online"
    }
  }
}

{
  "data": {
    "event": {
      "title": "Tweet Sentiment Extraction",
      "description": "A suggestion from last week's group was that we stay with the NLP theme but look for something practical. This week, we will look to apply our new knowledge to the current Kaggle Competition \"Tweet Sentiment Extraction\" - https://www.kaggle.com/c/tweet-sentiment-extraction\n\nThe meetup will begin with a short introduction to the competition, followed by our usual discussion format.\n\nAs always we encourage you all to attempt the competition before coming to the meet up. It is fine if you attempt the competition but do not manage to make a submission or get a high score on the leader board. The purpose of this meetup is to talk about what you did and to ask questions.\n\nHave a think about any research papers or Kaggle competitions you would like to discuss in future meetups. We will spend a few minutes on this at the end.\n\nThis meetup will be held online via video conference. Information about connecting to the meeting will be sent out closer to the time.",
      "dateTime": "2020-05-07T18:30+12:00",
      "eventUrl": "https://www.meetup.com/Data-Science-Discussion-Auckland/events/269946902",
      "going": 33,
      "waiting": 0,
      "eventType": "physical"
    }
  }
}

{
  "data": {
    "event": {
      "title": "Mechanisms of Action Prediction (ONLINE)",
      "description": "Tabular datasets are our bread and butter, we eagerly check our emails multiple times per day, hoping that Kaggle are going to announce a new competition with a tabular dataset. Sadly, these emails are becoming further and further apart. Although, last week, one such email arrived.\n\nThis week we are looking at the Kaggle competition: Mechanisms of Action (MoA) Prediction https://www.kaggle.com/c/lish-moa Similar to the \"Flu\" competition we have been looking at, this competition has multiple labels to predict, so allows us to continue looked into stacking models.\n\nAs always we encourage you all to attempt the competition before coming to the meet up. It is fine if you attempt the competition but do not manage to make a submission or get a high score on the leader-board. The purpose of this meetup is to talk about what you did and to ask questions.\n\nHave a think about any research papers or Kaggle competitions you would like to discuss in future meetups. We will spend a few minutes on this at the end\n\nPlease note, we intend to have this meetup online but may move to our regular venue depending on the Alert level. If this is the case an email will be sent out and this description will be updated. If online proceeds, connection information will be sent out by email through meetup to those who have RSVP'd.",
      "dateTime": "2020-09-24T18:30+12:00",
      "eventUrl": "https://www.meetup.com/Data-Science-Discussion-Auckland/events/273156810",
      "going": 25,
      "waiting": 0,
      "eventType": "online"
    }
  }
}

